          <div className='container'>
            <span className='fond_ico'></span>
            <span className='fond_ico'></span>
            <span className='fond_ico'></span>
          </div>
      </div> 

      <div className="container_genres">

        <h1 className="genre">Hardcore</h1>
        <h1 className="genre">Gabber</h1>
        <h1 className="genre">Doomcore</h1>
        <h1 className="genre">Techno</h1>

      </div>

    </div>
    
  );
}

export default Musique;
